class signup extends React.Component {

    onClick = () => {
        console.log("clicked!")
    }

    render() {
        return (
            <div className= "mainBody">
                <div className="createAccountMain">
                    <div style={{display: "flex", flexDirection: "column", justifyContent: "space-between", alignItems: "center"}}>
                        <h1 style={{color: "white"}}>Create an Account</h1>
                        <input type="text" placeholder="Username"/>
                        <input type="text" placeholder="Email"/>
                        <input type="password" placeholder="Password"/>
                        <input type="password" placeholder="Re-type Password"/>
                        <button type="button" onClick={this.onClick}>Signup</button>
                    </div>

                </div>
            <style jsx>{`
                .createAccountMain {
                    width: 60%;
                    height: 85%;
                    background: blue;
                    display: flex;
                    flex-direction: column;
                    align-items: center;
                    border-radius: 25px;
                    background: rgb(18, 65, 196)
                }

                .mainBody {
                    height: 40rem;
                    display: flex;
                    justify-content: center;
                    align-items: center;
                }

                input {
                    height: 2.5rem;
                    width: 28rem;
                    border-radius: 25px;
                    border: 3px solid grey;
                    font-size: 1.2rem;
                    background: rgba(201, 222, 255, .6);
                    color: white
                }

                input::placeholder {
                    text-align: center;
                    margin-left: -1rem;
                    font-size: 1.2rem;
                    color: white

                }
                input:focus {
                    outline: none;
                }

                button {
                    border-radius: 25px;
                    height: 3rem;
                    width: 16rem;
                    background: none;
                    highlight: none;
                    border: 3px solid grey;
                }

                button:focus {
                    outline: none
                }

                h1 {
                    margin-bottom: 3rem;
                    margin-top: 2rem
                }
            `}</style>
            </div>
        )
    }
}

export default signup
